class BookingListingService extends common_service.Token {
    async getExposedGuestBookings(params) {
        const token = this.getToken();
        if (!token) {
            throw new common_service.MissingTokenError();
        }
        const { data } = await common_service.axios.post(`/Get_Exposed_Guest_Bookings?Ticket=${token}`, params);
        if (data['ExceptionMsg'] !== '') {
            throw new Error(data['ExceptionMsg']);
        }
        return { bookings: data['My_Result'], total_count: data['My_Params_Get_Exposed_Guest_Bookings'].total_count };
    }
}

